import background from './background.svg';
import timeline from './timeline.svg';
import './App.css';

function App() {
  return (
    <div>
      <div>
        <header className="App-header">
          <img src={background} />
          <div>
        <p className="main-text">
            Aakriti & Henry
          </p>
      </div>
        </header>
      </div>
      <div className="timeline">
            <img src={timeline} />
          </div>
    </div>
  );
}

export default App;
